import React, { useEffect, useState } from "react";

export default function Circle() {
  const [user, setUser] = useState({});
  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results[0]));
  }, []);

  return (
    <div>
      {" "}
      Hi!
      {user.map((info) => (
        <div>{info}</div>
      ))}{" "}
    </div>
  );
}
